import React from "react";
import "./About.css"; // Import the styles
import "./theme.css"; // Ensure the theme styles are applied

const About = () => {
  return (
    <div className="about-container">
      <div className="about-box">
        <p>
          Welcome to TrackFit! Our AI-powered platform helps you track, transform, 
          and thrive by providing personalized health insights tailored just for you.
        </p>
      </div>
    </div>
  );
};

export default About;
